        "content": "## 📘 特斯拉量化技术指标Webhooks工具\n\n### 🔧 功能定位：\n\n本工作流作为**核心API数据采集器**，覆盖特斯拉全时段技术指标分析：\n👉 `15分钟`、`1小时`和`日线`三大周期\n\n自动触发并格式化每个周期下的6种Alpha Vantage技术指标，输出标准化JSON数据结构供下游AI分析工具调用。\n\n---\n\n### 🧱 支持指标（每周期）：\n\n* **RSI** – 相对强弱指数\n* **MACD** – 指数平滑异同平均线\n* **BBANDS** – 布林带\n* **SMA** – 简单移动平均线\n* **EMA** – 指数移动平均线\n* **ADX** – 平均趋向指数\n\n---\n\n### 📂 必备依赖项：\n\n* ✅ **Alpha Vantage高级版API密钥** – 需在n8n凭证管理中配置\n* ✅ 需配合以下父工作流使用：\n\n  * 特斯拉金融市场数据分析工具\n  * 特斯拉15分钟/1小时/日线指标工具\n\n---\n\n### 🛠️ 分步安装指南：\n\n1. **导入工作流**\n\n   * 将JSON配置文件加载至n8n实例\n\n2. **配置Alpha Vantage凭证**\n\n   * 进入n8n**凭证管理**\n   * 新建**HTTP查询认证**凭证：\n     `Alpha Vantage高级版`\n   * 键值设为`apikey`并填入有效API密钥\n\n3. **连接调用端**\n\n   * 本工具开放**3个webhook端点**：\n\n     * `/15minData`\n     * `/1hourData`\n     * `/1dayData`\n\n   当被其他工作流触发时，系统将：\n\n   * 拉取全部6项指标\n   * 格式化为清洁JSON（含`指标类型`、`时间周期`、`数据`）\n   * 按周期合并为单一数据对象\n   * 通过Webhook响应节点返回\n\n4. **验证输出**\n   示例响应：\n\n   ```json\n   {\n     \"indicator\": \"RSI\",\n     \"timeframe\": \"1h\",\n     \"data\": {\n       \"2025-05-15 14:00\": \"58.42\",\n       ...\n     }\n   }\n   ```\n\n---\n\n### 🧠 内部架构\n\n每个时间周期（15分钟/1小时/日线）包含：\n\n* ✅ 6个HTTP请求节点\n* ✅ 6个数据格式化节点（提取最近20个值）\n* ✅ 合并节点（聚合结果）\n* ✅ Webhook入口节点\n* ✅ Webhook响应节点（返回父工作流）\n\nn8n便签颜色规范：\n\n| 模块           | 颜色   | 说明                         |\n| -------------- | ------ | ---------------------------- |\n| Webhook入口    | 蓝色   | 触发路径说明                 |\n| API调用        | 黄色   | HTTP指标请求节点列表         |\n| 数据格式化     | 紫色   | 清洗Alpha Vantage原始数据    |\n| 数据合并       | 绿色   | 生成最终指标数组             |\n| Webhook响应    | 蓝色   | 返回结构化JSON               |\n\n---\n\n### 🧩 兼容时间周期\n\n| Webhook路径   | 调用场景                     |\n| ------------- | --------------------------- |\n| `/15minData`  | 特斯拉15分钟指标工具        |\n| `/1hourData`  | 特斯拉1小时指标工具         |\n| `/1dayData`   | 特斯拉日线指标工具          |\n\n---\n\n## 🚀 支持与授权\n\n🔗 **唐·贾亚玛哈 – 领英主页**\n[http://linkedin.com/in/donjayamahajr](http://linkedin.com/in/donjayamahajr)\n\n© 2025 Treasurium资本有